INSERT INTO `culture_content` VALUES (1,'春节 - 中国最重要的传统节日','春节是中国农历新年，是中国最重要的传统节日。人们会贴春联、放鞭炮、吃年夜饭、拜年等。春节期间，家人团聚，共度佳节。','http://localhost:8000/media/images/spring_festival.jpg','2026-01-08 09:53:34.080847','2026-01-14 14:11:45.088469',5,NULL,'article',2,10,0,NULL,0,NULL,NULL,'春节 - 中国最重要的传统节日 (Chinese)',NULL,NULL,NULL,NULL,NULL),(2,'饺子的制作方法','饺子是中国的传统食物。制作步骤：1. 准备馅料 2. 包饺子 3. 煮饺子。配上醋和酱油，味道更好。',NULL,'2026-01-08 09:53:34.086610','2026-01-14 14:11:45.085007',6,NULL,'video',1,15,0,'http://example.com/video/dumpling.mp4',0,NULL,NULL,'饺子的制作方法 (Chinese)',NULL,NULL,NULL,NULL,NULL),(3,'唐朝的历史与文化','唐朝（618-907年）是中国历史上最辉煌的朝代之一。唐朝在经济、文化、科技等方面都达到了很高的水平。',NULL,'2026-01-08 09:53:34.091298','2026-01-14 14:11:45.082967',7,NULL,'article',4,20,0,NULL,0,NULL,NULL,'唐朝的历史与文化 (Chinese)',NULL,NULL,NULL,NULL,NULL),(4,'中国八大菜系简介','中国八大菜系是指鲁菜、川菜、粤菜、苏菜、闽菜、浙菜、湘菜、徽菜。这八大菜系各具特色，展现了中国烹饪艺术的博大精深。\n\n鲁菜 - 起源于山东，北方菜系之首，历史悠久，技法丰富。\n\n川菜 - 起源于四川，以麻辣鲜香著称，百菜百味。\n\n粤菜 - 起源于广东，清淡鲜美，注重原味，精致考究。\n\n苏菜 - 起源于江苏，清鲜平和，刀工精细，造型美观。\n\n闽菜 - 起源于福建，重视汤鲜，善用红糟，味道独特。\n\n浙菜 - 起源于浙江，鲜嫩软滑，清爽利口，讲究原味。\n\n湘菜 - 起源于湖南，香辣酸咸，油重色浓，重口味。\n\n徽菜 - 起源于安徽，重油重色，擅长烧炖，朴素实惠。',NULL,'2026-01-10 08:54:10.675523','2026-01-10 08:54:10.675523',11,NULL,'article',3,15,0,NULL,0,'The Eight Great Cuisines of China refer to Shandong, Sichuan, Cantonese, Jiangsu, Fujian, Zhejiang, Hunan, and Anhui cuisines. Each has its unique characteristics, showcasing the profoundness of Chinese culinary art.\n\nShandong Cuisine - Originated in Shandong, the leader of northern cuisines, with a long history and rich techniques.\n\nSichuan Cuisine - Originated in Sichuan, famous for spicy and numbing flavors, every dish has its unique taste.\n\nCantonese Cuisine - Originated in Guangdong, light and fresh, emphasizing original flavors, refined and exquisite.\n\nJiangsu Cuisine - Originated in Jiangsu, fresh and mild, precise knife skills, beautiful presentation.\n\nFujian Cuisine - Originated in Fujian, emphasizes soup freshness, skilled in using red yeast rice, unique flavor.\n\nZhejiang Cuisine - Originated in Zhejiang, tender and smooth, refreshing taste, emphasizes original flavors.\n\nHunan Cuisine - Originated in Hunan, fragrant-spicy-sour-salty, heavy oil and deep color, strong flavors.\n\nAnhui Cuisine - Originated in Anhui, heavy oil and color, excels in braising and stewing, simple and affordable.','[{\"en\": \"The Eight Great Cuisines of China refer to Shandong, Sichuan, Cantonese, Jiangsu, Fujian, Zhejiang, Hunan, and Anhui cuisines. Each has its unique characteristics, showcasing the profoundness of Chinese culinary art.\", \"zh\": \"中国八大菜系是指鲁菜、川菜、粤菜、苏菜、闽菜、浙菜、湘菜、徽菜。这八大菜系各具特色，展现了中国烹饪艺术的博大精深。\"}, {\"en\": \"Shandong Cuisine - Originated in Shandong, the leader of northern cuisines, with a long history and rich techniques.\", \"zh\": \"鲁菜 - 起源于山东，北方菜系之首，历史悠久，技法丰富。\"}, {\"en\": \"Sichuan Cuisine - Originated in Sichuan, famous for spicy and numbing flavors, every dish has its unique taste.\", \"zh\": \"川菜 - 起源于四川，以麻辣鲜香著称，百菜百味。\"}, {\"en\": \"Cantonese Cuisine - Originated in Guangdong, light and fresh, emphasizing original flavors, refined and exquisite.\", \"zh\": \"粤菜 - 起源于广东，清淡鲜美，注重原味，精致考究。\"}, {\"en\": \"Jiangsu Cuisine - Originated in Jiangsu, fresh and mild, precise knife skills, beautiful presentation.\", \"zh\": \"苏菜 - 起源于江苏，清鲜平和，刀工精细，造型美观。\"}, {\"en\": \"Fujian Cuisine - Originated in Fujian, emphasizes soup freshness, skilled in using red yeast rice, unique flavor.\", \"zh\": \"闽菜 - 起源于福建，重视汤鲜，善用红糟，味道独特。\"}, {\"en\": \"Zhejiang Cuisine - Originated in Zhejiang, tender and smooth, refreshing taste, emphasizes original flavors.\", \"zh\": \"浙菜 - 起源于浙江，鲜嫩软滑，清爽利口，讲究原味。\"}, {\"en\": \"Hunan Cuisine - Originated in Hunan, fragrant-spicy-sour-salty, heavy oil and deep color, strong flavors.\", \"zh\": \"湘菜 - 起源于湖南，香辣酸咸，油重色浓，重口味。\"}, {\"en\": \"Anhui Cuisine - Originated in Anhui, heavy oil and color, excels in braising and stewing, simple and affordable.\", \"zh\": \"徽菜 - 起源于安徽，重油重色，擅长烧炖，朴素实惠。\"}]','Introduction to Chinese Eight Great Cuisines',NULL,NULL,NULL,NULL,NULL),(5,'中国八大菜系 - 鲁菜','鲁菜是中国传统四大菜系（也是八大菜系）中唯一的自发型菜系，是历史最悠久、技法最丰富的菜系，也是最难掌握的菜系。',NULL,'2026-01-10 08:54:10.688043','2026-01-14 14:33:07.570773',11,NULL,'article',3,12,0,NULL,2,'Shandong Cuisine is the only spontaneous cuisine among the traditional Four Great Cuisines (and Eight Cuisines) of China. It has the longest history, the richest techniques, and is the most difficult to master.\n\nShandong Cuisine originated from Jinan and Jiaodong areas in Shandong Province, emphasizing Confucius\' dietary philosophy of \"food can never be too refined, and minced meat can never be too finely cut\".\n\nCharacteristics of Shandong Cuisine include: careful selection of ingredients and precise knife skills; emphasis on seasoning with fresh and pure salty flavors; comprehensive cooking techniques, especially excelling in quick-frying, stir-frying, and braising; expertise in soup-making and soup usage.\n\nRepresentative dishes include: Sea Cucumber with Scallions, Jiuzhuan Large Intestine, Sweet and Sour Carp, and Four-Joy Meatballs.','[{\"en\": \"Shandong Cuisine is the only spontaneous cuisine among the traditional Four Great Cuisines (and Eight Cuisines) of China. It has the longest history, the richest techniques, and is the most difficult to master.\", \"zh\": \"鲁菜是中国传统四大菜系（也是八大菜系）中唯一的自发型菜系，是历史最悠久、技法最丰富的菜系，也是最难掌握的菜系。\"}, {\"en\": \"Shandong Cuisine originated from Jinan and Jiaodong areas in Shandong Province, emphasizing Confucius\' dietary philosophy of \\\"food can never be too refined, and minced meat can never be too finely cut\\\".\", \"zh\": \"鲁菜起源于山东省济南和胶东地区，讲究\\\"食不厌精，脍不厌细\\\"的孔子饮食思想。\"}, {\"en\": \"Characteristics of Shandong Cuisine include: careful selection of ingredients and precise knife skills; emphasis on seasoning with fresh and pure salty flavors; comprehensive cooking techniques, especially excelling in quick-frying, stir-frying, and braising; expertise in soup-making and soup usage.\", \"zh\": \"鲁菜的特点包括：选料考究，刀法精细；注重调味，口味鲜咸纯正；烹调技法全面，尤以爆、炒、扒见长；善于制汤，精于用汤。\"}, {\"en\": \"Representative dishes include: Sea Cucumber with Scallions, Jiuzhuan Large Intestine, Sweet and Sour Carp, and Four-Joy Meatballs.\", \"zh\": \"代表名菜有：葱烧海参、九转大肠、糖醋鲤鱼、四喜丸子等。\"}]','Eight Major Cuisines - Lu Cuisine','鲁菜是中国传统四大菜系（也是八大菜系）中唯一的自发型菜系，是历史最悠久、技法最丰富的菜系，也是最难掌握的菜系。','Lu Cuisine is the only spontaneous cuisine among the traditional four major cuisines (also eight major cuisines) in China, with the longest history, richest techniques, and most difficult to master.','{\"tips\": {\"en\": \"When tasting Lu Cuisine, pay attention to its rich northern flavor, especially the sophisticated use of scallions, ginger, and garlic.\", \"zh\": \"品尝鲁菜时，要注意其浓郁的北方风味，特别是葱姜蒜的运用非常讲究。\"}, \"origin\": {\"en\": \"Jinan and Jiaodong area of Shandong Province\", \"zh\": \"山东省济南和胶东地区\"}, \"culture\": {\"en\": \"Lu Cuisine follows Confucius\' philosophy of \\\"food should be refined and never tire of precision\\\", emphasizing authenticity and health.\", \"zh\": \"鲁菜讲究\\\"食不厌精，脍不厌细\\\"的孔子饮食思想，强调原汁原味和健康养生。\"}, \"famous_dishes\": [{\"desc\": {\"en\": \"Premium sea cucumber with scallions, fragrant and rich\", \"zh\": \"选用上等海参，配以大葱爆炒，鲜香浓郁\"}, \"name\": {\"en\": \"Braised Sea Cucumber with Scallions\", \"zh\": \"葱烧海参\"}}, {\"desc\": {\"en\": \"Pork intestine cooked to crispy outside and tender inside, with five flavors\", \"zh\": \"将猪大肠烧至外焦里嫩，酸甜咸辣香五味俱全\"}, \"name\": {\"en\": \"Nine-Turn Large Intestine\", \"zh\": \"九转大肠\"}}, {\"desc\": {\"en\": \"Yellow River carp as main ingredient, crispy outside, tender inside\", \"zh\": \"以黄河鲤鱼为主料，外焦里嫩，酸甜可口\"}, \"name\": {\"en\": \"Sweet and Sour Carp\", \"zh\": \"糖醋鲤鱼\"}}, {\"desc\": {\"en\": \"Symbolizing four joys of life, tender and nutritious\", \"zh\": \"象征人生四喜，肉质鲜嫩，营养丰富\"}, \"name\": {\"en\": \"Four-Joy Meatballs\", \"zh\": \"四喜丸子\"}}], \"characteristics\": {\"en\": [\"Meticulous ingredient selection, precise knife skills\", \"Emphasis on seasoning, fresh and salty taste\", \"Comprehensive cooking techniques, especially explosion, stir-frying, and braising\", \"Excellent at making and using soup\"], \"zh\": [\"选料考究，刀法精细\", \"注重调味，口味鲜咸纯正\", \"烹调技法全面，尤以爆、炒、扒见长\", \"善于制汤，精于用汤\"]}}','起源于山东，历史悠久，影响广泛','Originated from Shandong, with a long history and wide influence'),(6,'中国八大菜系 - 川菜','川菜以麻、辣、鲜、香为特色，味型多样，有\"一菜一格，百菜百味\"的美誉。',NULL,'2026-01-10 08:54:10.693679','2026-01-14 14:33:07.654595',11,NULL,'article',3,12,0,NULL,0,'Sichuan Cuisine uses a wide variety of ingredients, diverse seasonings, and varied dishes. It emphasizes both light-fresh and rich-intense flavors, and is famous for its skillful use of spicy and numbing seasonings.\n\nSichuan Cuisine originated from Chengdu and Chongqing areas in Sichuan Province, reflecting the passionate and unrestrained character of Sichuan people.\n\n\"Numbing\" and \"Spicy\" are the soul of Sichuan Cuisine. \"Numbing\" comes from Sichuan peppercorn, and \"Spicy\" comes from chili pepper - both are indispensable.\n\nRepresentative dishes include: Mapo Tofu, Kung Pao Chicken, Boiled Fish in Hot Chili Oil, and Twice-Cooked Pork.','[{\"en\": \"Sichuan Cuisine uses a wide variety of ingredients, diverse seasonings, and varied dishes. It emphasizes both light-fresh and rich-intense flavors, and is famous for its skillful use of spicy and numbing seasonings.\", \"zh\": \"川菜取材广泛，调味多变，菜式多样，口味清鲜醇浓并重，以善用麻辣调味著称。\"}, {\"en\": \"Sichuan Cuisine originated from Chengdu and Chongqing areas in Sichuan Province, reflecting the passionate and unrestrained character of Sichuan people.\", \"zh\": \"川菜起源于四川省成都和重庆地区，体现了四川人民热情奔放的性格。\"}, {\"en\": \"\\\"Numbing\\\" and \\\"Spicy\\\" are the soul of Sichuan Cuisine. \\\"Numbing\\\" comes from Sichuan peppercorn, and \\\"Spicy\\\" comes from chili pepper - both are indispensable.\", \"zh\": \"\\\"麻\\\"与\\\"辣\\\"是川菜的灵魂，\\\"麻\\\"来自花椒，\\\"辣\\\"来自辣椒，二者缺一不可。\"}, {\"en\": \"Representative dishes include: Mapo Tofu, Kung Pao Chicken, Boiled Fish in Hot Chili Oil, and Twice-Cooked Pork.\", \"zh\": \"代表名菜有：麻婆豆腐、宫保鸡丁、水煮鱼、回锅肉等。\"}]','Eight Major Cuisines - Sichuan Cuisine','川菜以麻、辣、鲜、香为特色，味型多样，有\"一菜一格，百菜百味\"的美誉。','Sichuan cuisine is characterized by numbing, spicy, fresh, and fragrant flavors, with diverse taste types and the reputation of \"one dish, one style, hundred dishes, hundred flavors\".','{\"tips\": {\"en\": \"For first-time tasters, start with mild spicy and gradually adapt to the numbing and spicy taste. Note that the \\\"numbing\\\" from Sichuan pepper and the \\\"spicy\\\" from chili are two different sensations.\", \"zh\": \"初次品尝川菜，建议从微辣开始，逐渐适应麻辣口味。注意花椒的\\\"麻\\\"和辣椒的\\\"辣\\\"是两种不同的感觉。\"}, \"origin\": {\"en\": \"Sichuan Basin\", \"zh\": \"四川盆地\"}, \"culture\": {\"en\": \"The spicy and numbing flavor of Sichuan cuisine originates from the hot and humid climate of the Sichuan Basin, where locals use chili and Sichuan pepper to dispel dampness and cold.\", \"zh\": \"川菜的麻辣味道源于四川盆地湿热的气候，当地人用辣椒和花椒驱湿除寒，形成了独特的饮食文化。\"}, \"famous_dishes\": [{\"desc\": {\"en\": \"Tender tofu, spicy and numbing, bright red color\", \"zh\": \"豆腐嫩滑，麻辣鲜香，色泽红亮\"}, \"name\": {\"en\": \"Mapo Tofu\", \"zh\": \"麻婆豆腐\"}}, {\"desc\": {\"en\": \"Fat but not greasy, aromatic, representative of Sichuan cuisine\", \"zh\": \"肥而不腻，香气四溢，是川菜代表\"}, \"name\": {\"en\": \"Twice-Cooked Pork\", \"zh\": \"回锅肉\"}}, {\"desc\": {\"en\": \"Fish tender and smooth, red spicy oil, very satisfying\", \"zh\": \"鱼肉滑嫩，辣油红亮，麻辣过瘾\"}, \"name\": {\"en\": \"Boiled Fish with Chili\", \"zh\": \"水煮鱼\"}}, {\"desc\": {\"en\": \"Tender chicken, crispy peanuts, balanced sweet and salty\", \"zh\": \"鸡肉嫩滑，花生香脆，咸甜适中\"}, \"name\": {\"en\": \"Kung Pao Chicken\", \"zh\": \"宫保鸡丁\"}}], \"characteristics\": {\"en\": [\"Skilled use of numbing and spicy, numb but not dull, spicy but not dry\", \"Diverse seasonings with \\\"seven flavors and eight tastes\\\"\", \"Wide range of ingredients and cooking methods\", \"Attention to heat control and knife skills\"], \"zh\": [\"善用麻辣，麻而不木，辣而不燥\", \"调味多样，有\\\"七滋八味\\\"之说\", \"取材广泛，烹调方法多样\", \"注重火候，讲究刀工\"]}}','麻辣鲜香，味型丰富，川味之魂','Spicy and numbing, rich flavors, the soul of Sichuan taste'),(7,'中国八大菜系 - 粤菜','粤菜以清淡、鲜嫩、滑爽、原汁原味为特色，选料精细，烹调技法多样。',NULL,'2026-01-10 08:54:10.700373','2026-01-14 14:33:07.663566',11,NULL,'article',3,12,0,NULL,0,'Cantonese Cuisine is one of the Four Great Cuisines of China, originated in Lingnan, consisting of Guangzhou, Chaozhou, and Dongjiang local flavors.\n\nCantonese Cuisine emphasizes quality and taste, with relatively light flavors, seeking freshness in lightness and beauty in blandness. It changes with seasons - lighter in summer and autumn, richer in winter and spring.\n\nRepresentative dishes include: White Cut Chicken, Roast Goose, Roast Suckling Pig, Braised Pigeon, Honey Glazed BBQ Pork, and Crispy Roast Pork.','[{\"en\": \"Cantonese Cuisine is one of the Four Great Cuisines of China, originated in Lingnan, consisting of Guangzhou, Chaozhou, and Dongjiang local flavors.\", \"zh\": \"粤菜是中国传统四大菜系之一，起源于岭南，由广州菜、潮州菜、东江菜三种地方风味组成。\"}, {\"en\": \"Cantonese Cuisine emphasizes quality and taste, with relatively light flavors, seeking freshness in lightness and beauty in blandness. It changes with seasons - lighter in summer and autumn, richer in winter and spring.\", \"zh\": \"粤菜注重质和味，口味比较清淡，力求清中求鲜、淡中求美。而且随季节时令的变化而变化，夏秋偏重清淡，冬春偏重浓郁。\"}, {\"en\": \"Representative dishes include: White Cut Chicken, Roast Goose, Roast Suckling Pig, Braised Pigeon, Honey Glazed BBQ Pork, and Crispy Roast Pork.\", \"zh\": \"代表名菜有：白切鸡、烧鹅、烤乳猪、红烧乳鸽、蜜汁叉烧、脆皮烧肉等。\"}]','Eight Major Cuisines - Cantonese Cuisine','粤菜以清淡、鲜嫩、滑爽、原汁原味为特色，选料精细，烹调技法多样。','Cantonese cuisine is characterized by lightness, tenderness, smoothness, and natural flavor, with careful ingredient selection and diverse cooking techniques.','{\"tips\": {\"en\": \"When tasting Cantonese cuisine, carefully savor the natural flavors of ingredients, don\'t add too much seasoning. Dim sum culture is an important part of Cantonese cuisine.\", \"zh\": \"品尝粤菜时，注意细细品味食材的原汁原味，不要加太多调料。早茶文化是粤菜的重要组成部分。\"}, \"origin\": {\"en\": \"Guangzhou and surrounding areas of Guangdong Province\", \"zh\": \"广东省广州及周边地区\"}, \"culture\": {\"en\": \"Cantonese cuisine emphasizes \\\"food should be refined\\\", focusing on ingredient freshness and cooking refinement, reflecting Guangdong people\'s attitude towards refined living.\", \"zh\": \"粤菜注重\\\"食不厌精\\\"，讲究食材的新鲜和烹饪的精致，体现了广东人精致生活的态度。\"}, \"famous_dishes\": [{\"desc\": {\"en\": \"Smooth skin, tender meat, preserving natural flavor\", \"zh\": \"鸡皮爽滑，肉质鲜嫩，保持原汁原味\"}, \"name\": {\"en\": \"White Cut Chicken\", \"zh\": \"白切鸡\"}}, {\"desc\": {\"en\": \"Crispy skin, tender meat, aromatic, bright red color\", \"zh\": \"皮脆肉嫩，香气扑鼻，色泽红亮\"}, \"name\": {\"en\": \"Roast Goose\", \"zh\": \"烧鹅\"}}, {\"desc\": {\"en\": \"Thin skin, fresh filling, translucent, classic Cantonese dim sum\", \"zh\": \"皮薄馅鲜，晶莹剔透，是粤式早茶经典\"}, \"name\": {\"en\": \"Shrimp Dumplings\", \"zh\": \"虾饺\"}}, {\"desc\": {\"en\": \"Tender fish, light and refreshing, preserving natural fish flavor\", \"zh\": \"鱼肉鲜嫩，清淡爽口，保持鱼的原汁原味\"}, \"name\": {\"en\": \"Steamed Grouper\", \"zh\": \"清蒸石斑鱼\"}}], \"characteristics\": {\"en\": [\"Careful ingredient selection, emphasis on freshness\", \"Light and palatable, preserving natural flavors\", \"Diverse cooking techniques, especially steaming and stir-frying\", \"Attention to seasoning and heat control\"], \"zh\": [\"选料精细，讲究鲜活\", \"清淡适口，保持原味\", \"烹调技法多样，尤以蒸、炒为主\", \"注重调味，讲究火候\"]}}','清淡鲜美，注重食材本味','Light and fresh, emphasizing natural flavors'),(8,'中国八大菜系 - 苏菜','苏菜以清鲜平和、浓而不腻为特色，选料严谨，制作精细。',NULL,'2026-01-10 08:54:10.707319','2026-01-14 14:33:07.671461',11,NULL,'article',3,12,0,NULL,0,'Jiangsu Cuisine is one of the Eight Great Cuisines of China, mainly based on Jiangsu cuisine, representing the culinary characteristics of the eastern coastal region of China.\n\nJiangsu Cuisine emphasizes knife skills, with fresh and mild flavors, excelling in stewing, braising, steaming, and stir-frying, with emphasis on soup preparation and preserving original flavors.\n\nRepresentative dishes include: Squirrel-shaped Mandarin Fish, Braised Pork Ball in Brown Sauce, Beggar\'s Chicken, and Crystal Meat.','[{\"en\": \"Jiangsu Cuisine is one of the Eight Great Cuisines of China, mainly based on Jiangsu cuisine, representing the culinary characteristics of the eastern coastal region of China.\", \"zh\": \"苏菜是中国传统八大菜系之一，以江苏菜系为主，代表中国东部沿海地区的菜系特色。\"}, {\"en\": \"Jiangsu Cuisine emphasizes knife skills, with fresh and mild flavors, excelling in stewing, braising, steaming, and stir-frying, with emphasis on soup preparation and preserving original flavors.\", \"zh\": \"苏菜注重刀工，口味清鲜平和，擅长炖、焖、蒸、炒，重视调汤，保持原汁。\"}, {\"en\": \"Representative dishes include: Squirrel-shaped Mandarin Fish, Braised Pork Ball in Brown Sauce, Beggar\'s Chicken, and Crystal Meat.\", \"zh\": \"代表名菜有：松鼠鳜鱼、清炖蟹粉狮子头、叫花鸡、水晶肴肉等。\"}]','Eight Major Cuisines - Jiangsu Cuisine','苏菜以清鲜平和、浓而不腻为特色，选料严谨，制作精细。','Jiangsu cuisine is characterized by freshness and mildness, rich but not greasy, with strict ingredient selection and fine preparation.','{\"tips\": {\"en\": \"When tasting Jiangsu cuisine, note its balanced sweet and salty taste, don\'t expect strong stimulation, but savor its fresh and mild charm.\", \"zh\": \"品尝苏菜时，注意其甜咸适中的口味特点，不要期待强烈的刺激感，而是细品其清鲜平和的韵味。\"}, \"origin\": {\"en\": \"Suzhou, Yangzhou, Nanjing and other areas of Jiangsu Province\", \"zh\": \"江苏省苏州、扬州、南京等地\"}, \"culture\": {\"en\": \"Jiangsu cuisine emphasizes \\\"Huaiyang fine cuisine\\\", reflecting the refined culture and prosperous life of the Jiangnan water towns.\", \"zh\": \"苏菜讲究\\\"淮扬细点\\\"，体现了江南水乡的精致文化和富庶生活。\"}, \"famous_dishes\": [{\"desc\": {\"en\": \"Unique shape, crispy outside tender inside, sweet and sour\", \"zh\": \"造型独特，外脆里嫩，酸甜可口\"}, \"name\": {\"en\": \"Squirrel-Shaped Mandarin Fish\", \"zh\": \"松鼠桂鱼\"}}, {\"desc\": {\"en\": \"Soft meat, fat but not greasy, melts in mouth\", \"zh\": \"肉质松软，肥而不腻，入口即化\"}, \"name\": {\"en\": \"Lion\'s Head Meatballs\", \"zh\": \"狮子头\"}}, {\"desc\": {\"en\": \"White skin, tender meat, fat but not greasy, fresh and delicious\", \"zh\": \"皮白肉嫩，肥而不腻，鲜香味美\"}, \"name\": {\"en\": \"Salt-Water Duck\", \"zh\": \"盐水鸭\"}}, {\"desc\": {\"en\": \"Distinct grains, excellent color, aroma and taste, representative of Jiangsu cuisine\", \"zh\": \"粒粒分明，色香味俱全，是苏菜代表\"}, \"name\": {\"en\": \"Yangzhou Fried Rice\", \"zh\": \"扬州炒饭\"}}], \"characteristics\": {\"en\": [\"Strict ingredient selection, emphasis on knife skills\", \"Attention to heat control, skilled in stewing\", \"Fresh taste, balanced sweet and salty\", \"Beautiful presentation, emphasis on plating\"], \"zh\": [\"选料严谨，讲究刀工\", \"注重火候，精于炖焖\", \"口味清鲜，甜咸适中\", \"造型美观，讲究摆盘\"]}}','清鲜平和，甜咸适中','Fresh and mild, balanced sweet and salty'),(9,'中国八大菜系 - 闽菜','闽菜以海鲜为主要原料，注重调汤，口味清鲜、淡爽。',NULL,'2026-01-10 08:54:10.714173','2026-01-14 14:33:07.679365',11,NULL,'article',3,12,0,NULL,0,'Fujian Cuisine is one of the Eight Great Cuisines of China, formed through the integration of Central Plains Han culture and local ancient Yue culture.\n\nFujian Cuisine is famous for cooking delicacies from mountains and seas. Based on excellent color, aroma, taste, and appearance, it especially excels in \"aroma\" and \"taste\", featuring fresh, mellow, fragrant but not greasy style.\n\nRepresentative dishes include: Buddha Jumps Over the Wall, Lychee Pork, Drunken Spare Ribs, and Red Wine Lees Chicken.','[{\"en\": \"Fujian Cuisine is one of the Eight Great Cuisines of China, formed through the integration of Central Plains Han culture and local ancient Yue culture.\", \"zh\": \"闽菜是中国八大菜系之一，经历了中原汉族文化和当地古越族文化的混合而形成。\"}, {\"en\": \"Fujian Cuisine is famous for cooking delicacies from mountains and seas. Based on excellent color, aroma, taste, and appearance, it especially excels in \\\"aroma\\\" and \\\"taste\\\", featuring fresh, mellow, fragrant but not greasy style.\", \"zh\": \"闽菜以烹制山珍海味而著称，在色香味形俱佳的基础上，尤以\\\"香\\\"、\\\"味\\\"见长，其清鲜、和醇、荤香、不腻的风格特色。\"}, {\"en\": \"Representative dishes include: Buddha Jumps Over the Wall, Lychee Pork, Drunken Spare Ribs, and Red Wine Lees Chicken.\", \"zh\": \"代表名菜有：佛跳墙、荔枝肉、醉排骨、红糟鸡等。\"}]','Eight Major Cuisines - Fujian Cuisine','闽菜以海鲜为主要原料，注重调汤，口味清鲜、淡爽。','Fujian cuisine uses seafood as main ingredients, emphasizes soup preparation, with fresh and light taste.','{\"tips\": {\"en\": \"When tasting Fujian cuisine, be sure to taste the soup, the essence of Fujian cuisine is in the soup. Pay attention to the fresh taste of seafood.\", \"zh\": \"品尝闽菜时，一定要品汤，闽菜的精华在汤中。注意品尝海鲜的鲜美原味。\"}, \"origin\": {\"en\": \"Fuzhou, southern Fujian and other areas of Fujian Province\", \"zh\": \"福建省福州、闽南等地\"}, \"culture\": {\"en\": \"Fujian cuisine is deeply influenced by Fujian\'s coastal geography, skilled in using seafood resources, forming a unique marine food culture.\", \"zh\": \"闽菜深受福建沿海地理环境影响，善于利用海鲜资源，形成了独特的海洋饮食文化。\"}, \"famous_dishes\": [{\"desc\": {\"en\": \"Rich ingredients, thick soup, nutritious\", \"zh\": \"食材丰富，汤汁浓郁，营养丰富\"}, \"name\": {\"en\": \"Buddha Jumps Over the Wall\", \"zh\": \"佛跳墙\"}}, {\"desc\": {\"en\": \"Shaped like lychee, sweet and sour, bright color\", \"zh\": \"形似荔枝，酸甜可口，色泽鲜艳\"}, \"name\": {\"en\": \"Lychee Pork\", \"zh\": \"荔枝肉\"}}, {\"desc\": {\"en\": \"Rich wine aroma, soft meat, balanced salty and sweet\", \"zh\": \"酒香浓郁，肉质酥软，咸甜适中\"}, \"name\": {\"en\": \"Drunken Spareribs\", \"zh\": \"醉排骨\"}}, {\"desc\": {\"en\": \"Bouncy fish meat, fresh soup, Fuzhou specialty\", \"zh\": \"鱼肉Q弹，汤汁鲜美，是福州特色\"}, \"name\": {\"en\": \"Fuzhou Fish Balls\", \"zh\": \"福州鱼丸\"}}], \"characteristics\": {\"en\": [\"Seafood-based, emphasis on freshness\", \"Attention to soup preparation, fresh soup\", \"Fine knife skills, bright colors\", \"Light taste, emphasis on natural flavors\"], \"zh\": [\"以海鲜为主，讲究鲜活\", \"注重调汤，汤鲜味美\", \"刀工精细，色彩艳丽\", \"口味清淡，注重原汁原味\"]}}','重视汤鲜，善用海鲜','Emphasis on soup freshness, skilled in seafood'),(10,'中国八大菜系 - 浙菜','浙菜以鲜嫩软滑、清香味美为特色，注重原汁原味。',NULL,'2026-01-10 08:54:10.721895','2026-01-14 14:33:07.685177',11,NULL,'article',3,12,0,NULL,0,'Zhejiang Cuisine is one of the Eight Great Cuisines of China with a long history. Zhejiang dishes taste fresh, crisp, and tender, maintaining the original color and true flavor of ingredients.\n\nZhejiang Cuisine emphasizes knife skills, fine preparation, diverse variations, and local flavor, excelling in quick-frying, stir-frying, braising, deep-frying, roasting, and steaming, featuring fresh, crisp, and tender characteristics.\n\nRepresentative dishes include: West Lake Vinegar Fish, Longjing Shrimp, Beggar\'s Chicken, and Dongpo Pork.','[{\"en\": \"Zhejiang Cuisine is one of the Eight Great Cuisines of China with a long history. Zhejiang dishes taste fresh, crisp, and tender, maintaining the original color and true flavor of ingredients.\", \"zh\": \"浙菜是中国传统八大菜系之一，有着悠久的历史。浙江菜品味清鲜脆嫩，保持原料的本色和真味。\"}, {\"en\": \"Zhejiang Cuisine emphasizes knife skills, fine preparation, diverse variations, and local flavor, excelling in quick-frying, stir-frying, braising, deep-frying, roasting, and steaming, featuring fresh, crisp, and tender characteristics.\", \"zh\": \"浙菜注重刀工、制作精细、变化较多、富有乡土气息，以爆、炒、烩、炸、烤、蒸见长，讲究清鲜脆嫩。\"}, {\"en\": \"Representative dishes include: West Lake Vinegar Fish, Longjing Shrimp, Beggar\'s Chicken, and Dongpo Pork.\", \"zh\": \"代表名菜有：西湖醋鱼、龙井虾仁、叫花童鸡、东坡肉等。\"}]','Eight Major Cuisines - Zhejiang Cuisine','浙菜以鲜嫩软滑、清香味美为特色，注重原汁原味。','Zhejiang cuisine is characterized by tenderness and smoothness, fragrant and delicious, emphasizing natural flavors.','{\"tips\": {\"en\": \"When tasting Zhejiang cuisine, note its light and elegant characteristics, especially Hangzhou cuisine, which incorporates the beautiful scenery and cultural heritage of West Lake.\", \"zh\": \"品尝浙菜时，注意其清淡雅致的特点，特别是杭州菜系，融入了西湖的秀美景色和文化底蕴。\"}, \"origin\": {\"en\": \"Hangzhou, Ningbo, Shaoxing and other areas of Zhejiang Province\", \"zh\": \"浙江省杭州、宁波、绍兴等地\"}, \"culture\": {\"en\": \"Zhejiang cuisine originates from Jiangnan water towns, influenced by West Lake scenery, emphasizing excellent \\\"color, aroma, taste, and shape\\\", reflecting the elegance of Jiangnan culture.\", \"zh\": \"浙菜源于江南水乡，受西湖美景影响，讲究\\\"色、香、味、形\\\"俱佳，体现了江南文化的优雅。\"}, \"famous_dishes\": [{\"desc\": {\"en\": \"Tender fish, sweet and sour, famous Hangzhou dish\", \"zh\": \"鱼肉鲜嫩，酸甜适口，是杭州名菜\"}, \"name\": {\"en\": \"West Lake Fish in Vinegar Gravy\", \"zh\": \"西湖醋鱼\"}}, {\"desc\": {\"en\": \"Fat but not greasy, melts in mouth, bright red color\", \"zh\": \"肥而不腻，入口即化，色泽红亮\"}, \"name\": {\"en\": \"Dongpo Pork\", \"zh\": \"东坡肉\"}}, {\"desc\": {\"en\": \"Tender shrimp, tea fragrance, light and elegant\", \"zh\": \"虾仁鲜嫩，茶香扑鼻，清淡雅致\"}, \"name\": {\"en\": \"Longjing Shrimp\", \"zh\": \"龙井虾仁\"}}, {\"desc\": {\"en\": \"Tender chicken, aromatic, unique flavor\", \"zh\": \"鸡肉酥烂，香气四溢，别具风味\"}, \"name\": {\"en\": \"Beggar\'s Chicken\", \"zh\": \"叫化童鸡\"}}], \"characteristics\": {\"en\": [\"Careful ingredient selection, rich variety\", \"Attention to knife skills and heat control\", \"Fresh taste, tender and smooth\", \"Emphasis on natural flavors, fragrant and delicious\"], \"zh\": [\"选料讲究，品种丰富\", \"注重刀工，讲究火候\", \"口味清鲜，鲜嫩软滑\", \"注重原汁原味，清香味美\"]}}','鲜嫩软滑，清香味美','Tender and smooth, fragrant and delicious'),(11,'中国八大菜系 - 湘菜','湘菜以香辣著称，注重酸辣、香鲜、软嫩，口味浓重。',NULL,'2026-01-10 08:54:10.726807','2026-01-14 14:33:07.691463',11,NULL,'article',3,12,0,NULL,0,'Hunan Cuisine is one of the Eight Great Cuisines of China, represented by Hunan dishes. It features fine preparation, wide range of ingredients, diverse flavors, and rich varieties.\n\nHunan Cuisine is characterized by heavy oil and deep color, emphasizing affordability; fragrant-spicy, fragrant-fresh, soft and tender. It emphasizes the matching of ingredients and the penetration of flavors.\n\nRepresentative dishes include: Fish Head with Chopped Chili, Spicy Chicken, Steamed Preserved Meat, and Zu\'an Shark Fin.','[{\"en\": \"Hunan Cuisine is one of the Eight Great Cuisines of China, represented by Hunan dishes. It features fine preparation, wide range of ingredients, diverse flavors, and rich varieties.\", \"zh\": \"湘菜是中国八大菜系之一，以湖南菜为代表。湘菜制作精细，用料广泛，口味多变，品种繁多。\"}, {\"en\": \"Hunan Cuisine is characterized by heavy oil and deep color, emphasizing affordability; fragrant-spicy, fragrant-fresh, soft and tender. It emphasizes the matching of ingredients and the penetration of flavors.\", \"zh\": \"湘菜的特点是油重色浓，讲求实惠；香辣、香鲜、软嫩。重视原料互相搭配，滋味互相渗透。\"}, {\"en\": \"Representative dishes include: Fish Head with Chopped Chili, Spicy Chicken, Steamed Preserved Meat, and Zu\'an Shark Fin.\", \"zh\": \"代表名菜有：剁椒鱼头、麻辣子鸡、腊味合蒸、组庵鱼翅等。\"}]','Eight Major Cuisines - Hunan Cuisine','湘菜以香辣著称，注重酸辣、香鲜、软嫩，口味浓重。','Hunan cuisine is famous for its spiciness, emphasizing sour, spicy, fragrant, fresh and tender, with strong flavors.','{\"tips\": {\"en\": \"The spiciness of Hunan cuisine is different from Sichuan cuisine\'s numbing spiciness, it\'s pure spiciness accompanied by sour aroma. First-time tasters should start with mild spicy.\", \"zh\": \"湘菜的辣不同于川菜的麻辣，是纯粹的辣，伴随着酸香。初次品尝建议从微辣开始。\"}, \"origin\": {\"en\": \"Changsha, Xiangtan and other areas of Hunan Province\", \"zh\": \"湖南省长沙、湘潭等地\"}, \"culture\": {\"en\": \"The chili culture of Hunan cuisine originates from Hunan\'s hot and humid climate, where locals use chili to dispel dampness and cold, forming a rich spicy culture.\", \"zh\": \"湘菜的辣椒文化源于湖南湿热的气候，当地人用辣椒驱湿除寒，形成了浓郁的辣文化。\"}, \"famous_dishes\": [{\"desc\": {\"en\": \"Tender fish, rich chili flavor, bright color\", \"zh\": \"鱼肉鲜嫩，辣椒香浓，色泽鲜艳\"}, \"name\": {\"en\": \"Steamed Fish Head with Chopped Chili\", \"zh\": \"剁椒鱼头\"}}, {\"desc\": {\"en\": \"Fat but not greasy, bright red color, sweet and soft\", \"zh\": \"肥而不腻，色泽红亮，香甜软糯\"}, \"name\": {\"en\": \"Mao\'s Braised Pork\", \"zh\": \"毛氏红烧肉\"}}, {\"desc\": {\"en\": \"Sour and spicy appetizer, salty and delicious, Hunan cuisine classic\", \"zh\": \"酸辣开胃，咸香可口，是湘菜经典\"}, \"name\": {\"en\": \"Xiangxi Grandma Vegetables\", \"zh\": \"湘西外婆菜\"}}, {\"desc\": {\"en\": \"Crispy chili, fresh pork, famous home-style dish\", \"zh\": \"辣椒脆嫩，肉质鲜香，是家常名菜\"}, \"name\": {\"en\": \"Stir-Fried Pork with Chili\", \"zh\": \"辣椒炒肉\"}}], \"characteristics\": {\"en\": [\"Skilled use of chili, spicy, sour and salty\", \"Attention to knife skills and heat control\", \"Strong flavors, bright colors\", \"Wide ingredient selection, many varieties\"], \"zh\": [\"善用辣椒，香辣酸咸\", \"注重刀工，讲究火候\", \"口味浓重，色泽鲜艳\", \"选料广泛，品种繁多\"]}}','香辣酸咸，口味浓重','Spicy, sour and salty, strong flavors'),(12,'中国八大菜系 - 徽菜','徽菜以烹制山珍野味著称，重油重色，讲究火功。','https://123456789-1325483916.cos.ap-nanjing.myqcloud.com/%E8%BF%94%E5%9B%9E%20%282%29.png','2026-01-10 08:54:10.731995','2026-01-14 14:33:07.697463',11,NULL,'article',3,12,0,NULL,0,'Anhui Cuisine is one of the Eight Great Cuisines of China, originated in Huizhou region of Anhui Province. It emphasizes fire control, excelling in braising, stewing, and steaming, with less quick-frying and stir-frying.\n\nAnhui Cuisine emphasizes heavy oil, deep color, and fire control. Dishes are glossy, aromatic, and rich in flavor. It excels in cooking mountain delicacies, game, river fish, and poultry.\n\nRepresentative dishes include: Stinky Mandarin Fish, Ham Stewed Soft-shelled Turtle, Pickled Fresh Mandarin Fish, and Braised Masked Palm Civet.','[{\"en\": \"Anhui Cuisine is one of the Eight Great Cuisines of China, originated in Huizhou region of Anhui Province. It emphasizes fire control, excelling in braising, stewing, and steaming, with less quick-frying and stir-frying.\", \"zh\": \"徽菜是中国八大菜系之一，起源于安徽省徽州地区。徽菜讲究火功，擅长烧、炖、蒸，而爆、炒菜较少。\"}, {\"en\": \"Anhui Cuisine emphasizes heavy oil, deep color, and fire control. Dishes are glossy, aromatic, and rich in flavor. It excels in cooking mountain delicacies, game, river fish, and poultry.\", \"zh\": \"徽菜重油、重色、重火功，色泽油亮，香气浓郁，滋味醇厚。擅长烹制山珍野味、河鲜家禽。\"}, {\"en\": \"Representative dishes include: Stinky Mandarin Fish, Ham Stewed Soft-shelled Turtle, Pickled Fresh Mandarin Fish, and Braised Masked Palm Civet.\", \"zh\": \"代表名菜有：臭鳜鱼、火腿炖甲鱼、腌鲜鳜鱼、红烧果子狸等。\"}]','Eight Major Cuisines - Anhui Cuisine','徽菜以烹制山珍野味著称，重油重色，讲究火功。','Anhui cuisine is famous for cooking mountain delicacies and game, rich in oil and color, emphasizing heat control.','{\"tips\": {\"en\": \"When tasting Anhui cuisine, note its rich oil and color characteristics, don\'t be scared by appearance, the taste is actually very delicious. Stinky Mandarin Fish is a must-try.\", \"zh\": \"品尝徽菜时，注意其重油重色的特点，不要被外表吓到，味道其实很鲜美。臭鳜鱼是必尝之菜。\"}, \"origin\": {\"en\": \"Huizhou area of Anhui Province\", \"zh\": \"安徽省徽州地区\"}, \"culture\": {\"en\": \"Anhui cuisine originates from Huizhou mountain area, uses local ingredients, skilled in mountain delicacies and game, reflecting the culture and culinary wisdom of Huizhou merchants.\", \"zh\": \"徽菜源于徽州山区，就地取材，善用山珍野味，体现了徽州商人的文化和饮食智慧。\"}, \"famous_dishes\": [{\"desc\": {\"en\": \"Smells stinky but tastes fragrant, tender fish, representative of Anhui cuisine\", \"zh\": \"闻着臭吃着香，鱼肉鲜嫩，是徽菜代表\"}, \"name\": {\"en\": \"Stinky Mandarin Fish\", \"zh\": \"臭鳜鱼\"}}, {\"desc\": {\"en\": \"Rich soup, soft meat, nutritious\", \"zh\": \"汤汁浓郁，肉质软烂，营养丰富\"}, \"name\": {\"en\": \"Stewed Turtle with Ham\", \"zh\": \"火腿炖甲鱼\"}}, {\"desc\": {\"en\": \"Tender pigeon, fragrant soup, nourishing\", \"zh\": \"鸽肉鲜嫩，汤汁清香，滋补养生\"}, \"name\": {\"en\": \"Huangshan Stewed Pigeon\", \"zh\": \"黄山炖鸽\"}}, {\"desc\": {\"en\": \"Crispy bamboo shoots, fragrant and refreshing, Anhui cuisine specialty\", \"zh\": \"笋质脆嫩，清香爽口，是徽菜特色\"}, \"name\": {\"en\": \"Wenzheng Mountain Bamboo Shoots\", \"zh\": \"问政山笋\"}}], \"characteristics\": {\"en\": [\"Skilled in cooking mountain delicacies, emphasis on ingredients\", \"Rich in oil and color, strong flavors\", \"Emphasis on heat control, skilled in stewing\", \"Preserving natural flavors, moderately fresh and salty\"], \"zh\": [\"善烹山珍野味，讲究食材\", \"重油重色，口味浓郁\", \"注重火功，擅长炖焖\", \"保持原汁原味，鲜咸适度\"]}}','重油重色，注重火功','Rich in oil and color, emphasis on heat control'),(13,'wqe','qewqw\n\nwq','https://123456789-1325483916.cos.ap-nanjing.myqcloud.com/%E9%82%AE%E7%AE%B1.png','2026-01-10 09:18:35.085352','2026-01-10 09:28:24.554876',7,NULL,'article',3,10,0,NULL,0,'qwew\n\nqew','[{\"en\": \"qwew\", \"zh\": \"qewqw\"}, {\"en\": \"qew\", \"zh\": \"wq\"}]','ewqe',NULL,NULL,NULL,NULL,NULL);
