INSERT INTO `hsk_info_faq` VALUES (1,'exam_info','HSK考试多久举办一次？','HSK考试在中国国内每月举办一次，在中国以外根据考点情况每年组织若干次考试。',NULL,1,0,1,'2026-01-08 09:53:34.145605','2026-01-08 09:53:34.145605'),(2,'registration','如何报名参加HSK考试？','您可以登录HSK官方网站（www.chinesetest.cn）在线报名，也可以到就近的考点现场报名。',NULL,2,0,1,'2026-01-08 09:53:34.150225','2026-01-08 09:53:34.150225');
