INSERT INTO `hsk_info_hsklevel` VALUES (1,1,'入门级','HSK一级考查考生的日常汉语应用能力，要求考生掌握并运用简单的汉语词语和句子，满足具体的交际需求，具备进一步学习汉语的能力。',150,'能听懂他人用非常简单的汉语就非常熟悉的日常话题进行的简短而缓慢的谈话。','能看懂简单的汉语字、词语及句子，理解用最常用汉字写成的简短文段的内容。','能用汉字写出简单的词语。',40,200,120,'[{\"part\": \"听力\", \"time\": 15, \"questions\": 20}, {\"part\": \"阅读\", \"time\": 17, \"questions\": 20}]','具有初步汉语基础，会用汉语就熟悉的日常话题进行简单而直接的交流',100,'hsk1-icon','#f5222d','2026-01-08 09:53:34.118857','2026-01-08 09:53:34.118857'),(2,3,'进阶级','HSK三级考查考生的汉语应用能力，要求考生掌握并运用相关汉语知识进行社会交际。',600,'能基本听懂用汉语进行的谈话或独白，掌握相关话题的主要内容。','能阅读汉语书刊杂志，欣赏简单的汉语报刊文章，理解其主要内容。','能就所熟悉的话题进行简单的书面表达。',85,300,180,'[{\"part\": \"听力\", \"time\": 35, \"questions\": 40}, {\"part\": \"阅读\", \"time\": 30, \"questions\": 30}, {\"part\": \"书写\", \"time\": 15, \"questions\": 10}]','具备运用汉语进行生活、学习、工作等方面基本交际的能力',300,'hsk3-icon','#fa8c16','2026-01-08 09:53:34.126015','2026-01-08 09:53:34.126015');
/*!40000 ALTER TABLE `hsk_info_hsklevel` ENABLE KEYS */;
