DROP TABLE IF EXISTS `question_question`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `question_question` (
  `id` bigint NOT NULL AUTO_INCREMENT,
  `type` varchar(50) COLLATE utf8mb4_unicode_ci NOT NULL,
  `level` int NOT NULL,
  `content` longtext COLLATE utf8mb4_unicode_ci NOT NULL,
  `options` json NOT NULL,
  `answer` longtext COLLATE utf8mb4_unicode_ci NOT NULL,
  `created_at` datetime(6) NOT NULL,
  `updated_at` datetime(6) NOT NULL,
  `explanation` longtext COLLATE utf8mb4_unicode_ci,
  `category_id` bigint DEFAULT NULL,
  `question_set_id` bigint DEFAULT NULL,
  `difficulty` int NOT NULL,
  `audio_duration` int NOT NULL,
  `audio_file` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `audio_url` varchar(500) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `image_file` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `image_url` varchar(500) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `matching_pairs` json DEFAULT NULL,
  `ordering_items` json DEFAULT NULL,
  `passage` longtext COLLATE utf8mb4_unicode_ci,
  `passage_title` varchar(200) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `points` int NOT NULL,
  `sub_questions` json DEFAULT NULL,
  `tags` json DEFAULT NULL,
  `time_limit` int NOT NULL,
  `audio_group` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `material_group` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `part_number` int DEFAULT NULL,
  `question_number` int DEFAULT NULL,
  `section_type` varchar(20) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `option_type` varchar(10) COLLATE utf8mb4_unicode_ci NOT NULL,
  PRIMARY KEY (`id`),
  KEY `question_question_category_id_48dd39ba_fk_question_` (`category_id`),
  KEY `question_question_question_set_id_689bf451_fk_question_` (`question_set_id`),
  CONSTRAINT `question_question_category_id_48dd39ba_fk_question_` FOREIGN KEY (`category_id`) REFERENCES `question_questioncategory` (`id`),
  CONSTRAINT `question_question_question_set_id_689bf451_fk_question_` FOREIGN KEY (`question_set_id`) REFERENCES `question_questionset` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1232 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
