xt'),(887,'fill',4,'请在空白处填入合适的词语','[[\"勤奋\", \"懒惰\", \"高兴\", \"难过\"], [\"跑步\", \"睡觉\", \"工作\", \"学习\"], [\"坏\", \"好\", \"累\", \"忙\"], [\"认真\", \"马虎\", \"简单\", \"困难\"], [\"休息\", \"迟到\", \"请假\", \"放弃\"]]','勤奋,跑步,好,认真,迟到','2026-01-08 09:39:37.100523','2026-01-11 07:58:44.417289','1.勤奋 2.跑步 3.好 4.认真 5.迟到',11,28,4,0,'',NULL,'',NULL,NULL,NULL,'\n    我的朋友小李是个很___1___的人。他每天早上六点就起床，\n    然后去公园___2___。他说运动对身体很___3___。\n    小李工作很___4___，但是他从来不___5___。\n    ',NULL,5,NULL,'{\"original_type\": \"cloze\"}',0,NULL,NULL,NULL,NULL,NULL,'text'),(889,'writing',5,'看图片，用至少80个字描述图片内容','[]','(开放性答案，需要人工评分)','2026-01-08 09:39:37.112092','2026-01-11 07:58:44.387464','可以描述：时间、地点、人物、活动、气氛等',17,28,5,0,'',NULL,'','http://localhost:8000/media/images/family_dinner.jpg',NULL,NULL,NULL,NULL,15,NULL,'{\"original_type\": \"image_description\"}',300,NULL,NULL,NULL,NULL,NULL,'text'),(1065,'reading',2,'HSK2阅读第21题：选择正确答案','[\"A\", \"B\", \"C\", \"D\"]','A','2026-01-08 10:10:18.874610','2026-01-08 10:10:18.874610','根据题目要求选择',2,30,2,0,'',NULL,'',NULL,NULL,NULL,NULL,NULL,5,NULL,NULL,0,NULL,NULL,NULL,NULL,NULL,'text'),(1066,'reading',2,'HSK2阅读第22题：选择正确答案','[\"A\", \"B\", \"C\", \"D\"]','A','2026-01-08 10:10:18.876646','2026-01-08 10:10:18.876646','根据题目要求选择',2,30,2,0,'',NULL,'',NULL,NULL,NULL,NULL,NULL,5,NULL,NULL,0,NULL,NULL,NULL,NULL,NULL,'text'),(1067,'reading',2,'HSK2阅读第23题：选择正确答案','[\"A\", \"B\", \"C\", \"D\"]','A','2026-01-08 10:10:18.880197','2026-01-08 10:10:18.880197','根据题目要求选择',2,30,2,0,'',NULL,'',NULL,NULL,NULL,NULL,NULL,5,NULL,NULL,0,NULL,NULL,NULL,NULL,NULL,'text'),(1068,'reading',2,'HSK2阅读第24题：选择正确答案','[\"A\", \"B\", \"C\", \"D\"]','A','2026-01-08 10:10:18.883319','2026-01-08 10:10:18.883319','根据题目要求选择',2,30,2,0,'',NULL,'',NULL,NULL,NULL,NULL,NULL,5,NULL,NULL,0,NULL,NULL,NULL,NULL,NULL,'text'),(1069,'reading',2,'HSK2阅读第25题：选择正确答案','[\"A\", \"B\", \"C\", \"D\"]','A','2026-01-08 10:10:18.886568','2026-01-08 10:10:18.886568','根据题目要求选择',2,30,2,0,'',NULL,'',NULL,NULL,NULL,NULL,NULL,5,NULL,NULL,0,NULL,