INSERT INTO `university_university` VALUES (10,'北京大学','上海',1,'[\"中国语言文学\", \"历史学\", \"哲学\", \"经济学\", \"法学\", \"数学\", \"物理学\", \"化学\", \"生物学\", \"计算机科学\"]','北京大学创办于1898年，初名京师大学堂，是中国第一所国立综合性大学，也是当时中国最高教育行政机关。北京大学是中国近代以来唯一以国家最高学府身份创立的学校，最初也是国家最高教育行政机关，行使教育部职能。','北京市海淀区颐和园路5号','','北京市','2026-01-09 05:56:19.015577','webmaster@pku.edu.cn','Peking University','综合性、研究型、世界一流','北京大学创办于1898年，初名京师大学堂，是中国第一所国立综合性大学。',8000,'HSK 5级及以上，部分专业要求6级','',5,'010-62751234','[\"中国语言文学\", \"经济学\", \"法学\", \"计算机科学\"]',1,12,'中国政府奖学金、北京大学国际学生奖学金','{\"labels\": [\"985工程\", \"双一流\"], \"establishYear\": 2000}',45000,26000.00,'2026-01-15 06:04:18.839309','https://www.pku.edu.cn','[{\"en\": \"Long history, first national comprehensive university\", \"zh\": \"历史悠久，是中国第一所国立综合性大学\"}, {\"en\": \"Comprehensive disciplines covering arts, sciences, engineering, medicine\", \"zh\": \"学科齐全，涵盖文理工医等多个领域\"}, {\"en\": \"Strong faculty with many renowned scholars\", \"zh\": \"师资力量雄厚，拥有众多知名学者\"}, {\"en\": \"Extensive international exchange with top universities\", \"zh\": \"国际交流广泛，与世界顶尖大学合作\"}]','[{\"en\": \"Located in Haidian District, Beijing, convenient transportation\", \"zh\": \"位于北京海淀区，交通便利\"}, {\"en\": \"Beautiful campus with complete facilities\", \"zh\": \"校园环境优美，设施齐全\"}, {\"en\": \"Rich club activities and academic lectures\", \"zh\": \"丰富的社团活动和学术讲座\"}, {\"en\": \"Multicultural atmosphere with many international students\", \"zh\": \"多元文化氛围，国际学生众多\"}]','Peking University was founded in 1898 as the Imperial University of Peking. It is the first national comprehensive university in China and was also the highest educational administrative organ at that time.','Comprehensive, Research-oriented, World-class','Peking University was founded in 1898 as the Imperial University of Peking, the first national comprehensive university in China.'),(11,'清华大学','北京',2,'[\"计算机科学\", \"电子工程\", \"自动化\", \"建筑学\", \"土木工程\", \"机械工程\", \"经济管理\", \"物理学\", \"数学\", \"化学\"]','清华大学的前身清华学堂始建于1911年，1912年更名为清华学校。1928年更名为国立清华大学。清华大学是中国乃至亚洲最著名的高等学府之一，在长达百年的办学历史中，2位共和国主席、7位中央政治局常委、14名两弹一星获得者。','北京市海淀区清华园1号','','北京市','2026-01-09 05:56:19.018092','webmaster@tsinghua.edu.cn','Tsinghua University','理工见长，综合发展，世界一流','清华大学的前身清华学堂始建于1911年，1912年更名为清华学校，1928年更名为国立清华大学。',7000,'HSK 5级及以上，理工科专业要求较低','',5,'010-62782051','[\"计算机科学\", \"电子工程\", \"自动化\", \"经济管理\"]',2,17,'中国政府奖学金、清华大学国际学生奖学金','[\"985工程\", \"211工程\", \"双一流\", \"C9联盟\"]',48000,26000.00,'2026-01-10 09:22:28.898513','https://www.tsinghua.edu.cn','[{\"en\": \"Strong engineering programs, leading in multiple disciplines\", \"zh\": \"工科实力雄厚，多个学科全国领先\"}, {\"en\": \"Rich research achievements, outstanding innovation capability\", \"zh\": \"科研成果丰硕，创新能力突出\"}, {\"en\": \"High employment rate, graduates highly welcomed by companies\", \"zh\": \"就业率高，毕业生深受企业欢迎\"}, {\"en\": \"High internationalization, extensive international cooperation\", \"zh\": \"国际化程度高，国际合作广泛\"}]','[{\"en\": \"Located in Haidian District, adjacent to Peking University\", \"zh\": \"位于北京海淀区，毗邻北京大学\"}, {\"en\": \"Beautiful campus, known as one of the most beautiful universities\", \"zh\": \"校园风景优美，被誉为最美大学之一\"}, {\"en\": \"Strong sports atmosphere, complete sports facilities\", \"zh\": \"体育氛围浓厚，体育设施完善\"}, {\"en\": \"Rigorous academic atmosphere, active innovation and entrepreneurship\", \"zh\": \"学术氛围严谨，创新创业氛围活跃\"}]','Tsinghua University originated from Tsinghua School founded in 1911. Renamed Tsinghua University in 1928. It is one of the most prestigious universities in China and Asia, with a century-long history of producing numerous leaders and scientists.','Strong in engineering and science, comprehensive development, world-class','Tsinghua University originated from Tsinghua School founded in 1911, renamed Tsinghua University in 1928.'),(12,'复旦大学','上海',3,'[\"中国语言文学\", \"新闻传播学\", \"经济学\", \"国际关系\", \"数学\", \"物理学\", \"化学\", \"生物学\", \"医学\", \"管理学\"]','复旦大学创建于1905年，原名复旦公学，1917年定名为复旦大学，是中国人自主创办的第一所高等院校。学校已经成为一所包括人文科学、自然科学、技术科学以及管理科学在内的多科性研究型综合大学。','上海市杨浦区邯郸路220号','','上海市','2026-01-09 05:56:19.020349','webmaster@fudan.edu.cn','Fudan University','文理并重，多学科协调发展','复旦大学创建于1905年，原名复旦公学，1917年定名为复旦大学，是中国人自主创办的第一所高等院校。',6000,'HSK 5级及以上，部分专业要求6级','',5,'021-65642222','[\"新闻传播学\", \"经济学\", \"国际关系\", \"医学\"]',3,34,'中国政府奖学金、上海市政府奖学金、复旦大学国际学生奖学金','[\"985工程\", \"211工程\", \"双一流\"]',35000,23000.00,'2026-01-10 09:22:28.905106','https://www.fudan.edu.cn','[{\"en\": \"Complete disciplines in arts, sciences, medicine, engineering with balanced strength\", \"zh\": \"文理医工学科齐全，实力均衡\"}, {\"en\": \"Located in Shanghai, economically developed with numerous opportunities\", \"zh\": \"位于上海，经济发达，机会众多\"}, {\"en\": \"High level of internationalization, frequent international exchanges\", \"zh\": \"国际化水平高，国际交流频繁\"}, {\"en\": \"Rich humanistic tradition and campus culture\", \"zh\": \"人文传统深厚，校园文化丰富\"}]','[{\"en\": \"Located in downtown Shanghai, convenient transportation, rich life\", \"zh\": \"位于上海市区，交通便利，生活丰富\"}, {\"en\": \"Beautiful campus with many historical buildings\", \"zh\": \"校园环境优美，历史建筑众多\"}, {\"en\": \"Rich club activities, active student organizations\", \"zh\": \"社团活动丰富，学生组织活跃\"}, {\"en\": \"Strong international atmosphere, many international students\", \"zh\": \"国际化氛围浓厚，留学生众多\"}]','Fudan University was founded in 1905, originally named Fudan Public School. Renamed Fudan University in 1917. It is the first higher education institution independently established by Chinese people, now a comprehensive research university.','Equal emphasis on liberal arts and sciences, coordinated multi-disciplinary development','Founded in 1905 as Fudan Public School, renamed Fudan University in 1917, the first higher education institution independently established by Chinese.'),(13,'上海交通大学','上海',4,NULL,'上海交通大学是我国历史最悠久、享誉海内外的著名高等学府之一，是教育部直属并与上海市共建的全国重点大学。经过120多年的不懈努力，上海交通大学已经成为一所\"综合性、研究型、国际化\"的国内一流、国际知名大学。','上海市闵行区东川路800号','','上海市','2026-01-09 05:56:19.022007','webmaster@sjtu.edu.cn','Shanghai Jiao Tong University','','创建于1896年',0,'','',5,'021-34200000',NULL,NULL,NULL,'','[\"985工程\", \"211工程\", \"双一流\"]',0,NULL,'2026-01-09 05:56:19.023021','https://www.sjtu.edu.cn',NULL,NULL,NULL,NULL,NULL),(14,'浙江大学','浙江',5,NULL,'浙江大学是一所历史悠久、声誉卓著的高等学府，坐落于中国历史文化名城、风景旅游胜地杭州。浙江大学的前身求是书院创立于1897年，为中国人自己最早创办的新式高等学校之一。','浙江省杭州市西湖区余杭塘路866号','','杭州市','2026-01-09 05:56:19.024263','webmaster@zju.edu.cn','Zhejiang University','','创建于1897年，原名求是书院',0,'','',5,'0571-87951111',NULL,NULL,NULL,'','[\"985工程\", \"211工程\", \"双一流\"]',0,NULL,'2026-01-09 05:56:19.024263','https://www.zju.edu.cn',NULL,NULL,NULL,NULL,NULL),(15,'南京大学','江苏',6,NULL,'南京大学坐落于钟灵毓秀、虎踞龙蟠的金陵古都，是一所历史悠久、声誉卓著的百年名校。其前身是创建于1902年的三江师范学堂，此后历经两江师范学堂、南京高等师范学校、国立东南大学、国立中央大学、国立南京大学等历史时期，于1950年更名为南京大学。','江苏省南京市栖霞区仙林大道163号','','南京市','2026-01-09 05:56:19.025375','webmaster@nju.edu.cn','Nanjing University','','创建于1902年',0,'','',5,'025-83593186',NULL,NULL,NULL,'','[\"985工程\", \"211工程\", \"双一流\"]',0,NULL,'2026-01-09 05:56:19.025375','https://www.nju.edu.cn',NULL,NULL,NULL,NULL,NULL),(16,'武汉大学','湖北',7,NULL,'武汉大学是国家教育部直属重点综合性大学，是国家\"985工程\"和\"211工程\"重点建设高校，是首批\"双一流\"建设高校。武汉大学溯源于1893年清末湖广总督张之洞奏请清政府创办的自强学堂，历经传承演变，1928年定名为国立武汉大学，是近代中国第一批国立大学。','湖北省武汉市武昌区珞珈山街16号','','武汉市','2026-01-09 05:56:19.026569','webmaster@whu.edu.cn','Wuhan University','','创建于1893年',0,'','',5,'027-68755114',NULL,NULL,NULL,'','[\"985工程\", \"211工程\", \"双一流\"]',0,NULL,'2026-01-09 05:56:19.026569','https://www.whu.edu.cn',NULL,NULL,NULL,NULL,NULL),(17,'中山大学','广东',8,NULL,'中山大学由孙中山先生创办，有着一百多年办学传统。作为中国教育部直属高校，通过部省共建，中山大学已经成为一所国内一流、国际知名的现代综合性大学。现由广州校区、珠海校区、深圳校区三个校区、五个校园组成。','广东省广州市海珠区新港西路135号','','广州市','2026-01-09 05:56:19.026569','webmaster@mail.sysu.edu.cn','Sun Yat-sen University','','由孙中山先生创办于1924年',0,'','',5,'020-84110000',NULL,NULL,NULL,'','[\"985工程\", \"211工程\", \"双一流\"]',0,NULL,'2026-01-09 05:56:19.026569','https://www.sysu.edu.cn',NULL,NULL,NULL,NULL,NULL),(18,'华中科技大学','湖北',9,NULL,'华中科技大学是国家教育部直属重点综合性大学，由原华中理工大学、同济医科大学、武汉城市建设学院于2000年5月26日合并成立，是国家\"211工程\"重点建设和\"985工程\"建设高校之一，是首批\"双一流\"建设高校。','湖北省武汉市洪山区珞喻路1037号','','武汉市','2026-01-09 05:56:19.028802','webmaster@hust.edu.cn','Huazhong University of Science and Technology','','创建于1952年',0,'','',5,'027-87542228',NULL,NULL,NULL,'','[\"985工程\", \"211工程\", \"双一流\"]',0,NULL,'2026-01-09 05:56:19.028802','https://www.hust.edu.cn',NULL,NULL,NULL,NULL,NULL),(19,'四川大学','四川',10,NULL,'四川大学是教育部直属全国重点大学，是国家布局在中国西部的重点建设的高水平研究型综合大学。四川大学地处中国历史文化名城——\"天府之国\"的成都，有望江、华西和江安三个校区，占地面积7050亩，校舍建筑面积280多万平方米。','四川省成都市武侯区望江路29号','','成都市','2026-01-09 05:56:19.031242','webmaster@scu.edu.cn','Sichuan University','','创建于1896年',0,'','',5,'028-85405111',NULL,NULL,NULL,'','[\"985工程\", \"211工程\", \"双一流\"]',0,NULL,'2026-01-09 05:56:19.031242','https://www.scu.edu.cn',NULL,NULL,NULL,NULL,NULL);
